var DataStructures=DataStructures||{};DataStructures.Common=DataStructures.Common||{};DataStructures.Common.dump=function(){var e="";var t=this.length;console.log("* Dumping "+this.id+" of length: "+t);while(t--){e+=this[t].toString()+";"}console.log("* Dump: "+e)};DataStructures.Stack=function(){this.id="Stack"};DataStructures.Stack.prototype=new Array;DataStructures.Stack.prototype.dump=DataStructures.Common.dump;DataStructures.LinkedList=function(){this.id="LinkedList"};DataStructures.LinkedList.prototype=new Array;DataStructures.LinkedList.prototype.dump=DataStructures.Common.dump;DataStructures.LinkedList.prototype.add=function(e){this.push(e)};DataStructures.LinkedList.prototype.remove=function(e){this.splice(this.indexOf(e),1)}